function getCurrentlyLoggedUserInfo() {
    return 0 <= window.location.href.search(FB_MESSAGE_URL) ? getUserInfoObject(getUserInfoFromFbScript()) : null
}
function getUserInfoObject(a) {
    var b = {}; b.pageGenTime = getPageGenerationTime(a); b.revision = getRevision(a);
    b.accountId = getAccountId(a);
    b.pkgCoHort = getPkgCoHort(a);
    b.spinr = getSpinR(a); b.spinb = getSpinB(a);
    b.spint = getSpinT(a); b.token = getToken(a);
    return b
} function getAccountId(a) { return extractUserInfo(a, "CurrentUserInitialData", "ACCOUNT_ID") }
function getRevision(a) {
    return extractUserInfo(a, "SiteData", "client_revision")
}
function getPkgCoHort(a) { return extractUserInfo(a, "SiteData", "pkg_cohort") }
function getPageGenerationTime(a) { return extractUserInfo(a, "SiteData", "page_gen_time") }
function getToken(a) { return extractUserInfo(a, "DTSGInitialData", "token") }
function getSpinR(a) { return extractUserInfo(a, "SiteData", "__spin_r") }
function getSpinB(a) { return extractUserInfo(a, "SiteData", "__spin_b") }
function getSpinT(a) {
    return extractUserInfo(a, "SiteData", "__spin_t")
}
function getUserInfoFromFbScript() {
    for (var a = null, b = document.querySelectorAll("script"), d = 0; d < b.length; d++) {
        var c = b[d].innerHTML;
        if (1 < c.search("TimeSlice") && 1 < c.search("USER_ID")) {
            a = JSON.parse(c.substring(c.search("handleDefines") + 14, c.search("new ") - 2));
            break
        }
    } return a
} function extractUserInfo(a, b, d) {
    for (var c = null, e = 0; e < a.length; e++)
        if (a[e][0] == b) {
            c = a[e][2][d];
            break
        } return c
};
